int cModuleDescriptor::findField(const char *fieldName) const
{
    omnetpp::cClassDescriptor *basedesc = getBaseClassDescriptor();
    int base = basedesc ? basedesc->getFieldCount() : 0;
    if (fieldName[0] == 'i' && strcmp(fieldName, "id") == 0) return base+0;
    if (fieldName[0] == 'i' && strcmp(fieldName, "isSimple") == 0) return base+1;
    if (fieldName[0] == 'i' && strcmp(fieldName, "isVector") == 0) return base+2;
    if (fieldName[0] == 'i' && strcmp(fieldName, "index") == 0) return base+3;
    if (fieldName[0] == 's' && strcmp(fieldName, "size") == 0) return base+4;
    if (fieldName[0] == 'b' && strcmp(fieldName, "builtinAnimationsAllowed") == 0) return base+5;
    if (fieldName[0] == 'd' && strcmp(fieldName, "displayString") == 0) return base+6;
    if (fieldName[0] == 'g' && strcmp(fieldName, "gate") == 0) return base+7;
    if (fieldName[0] == 'c' && strcmp(fieldName, "canvas") == 0) return base+8;
    if (fieldName[0] == 'o' && strcmp(fieldName, "osgCanvas") == 0) return base+9;
    return basedesc ? basedesc->findField(fieldName) : -1;
}

