int cAbstractHistogramDescriptor::findField(const char *fieldName) const
{
    omnetpp::cClassDescriptor *basedesc = getBaseClassDescriptor();
    int base = basedesc ? basedesc->getFieldCount() : 0;
    if (fieldName[0] == 'b' && strcmp(fieldName, "binsAlreadySetUp") == 0) return base+0;
    if (fieldName[0] == 'u' && strcmp(fieldName, "underflowSumWeights") == 0) return base+1;
    if (fieldName[0] == 'o' && strcmp(fieldName, "overflowSumWeights") == 0) return base+2;
    if (fieldName[0] == 'n' && strcmp(fieldName, "numBins") == 0) return base+3;
    if (fieldName[0] == 'b' && strcmp(fieldName, "binInfo") == 0) return base+4;
    return basedesc ? basedesc->findField(fieldName) : -1;
}

